import React, { useEffect, useState } from "react";
import { facebook, google, signup } from "../assets";
import { useAuthState } from "react-firebase-hooks/auth";
import {
  auth,
  loginWithEmail,
  signInWithGoogle,
  logout,
} from "../firebase/Firebase";
import { Link, useNavigate } from "react-router-dom";

export const Signup = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [user, loading, error] = useAuthState(auth);
  const [loader, setLoader] = useState(false);
  const navigate = useNavigate();
  useEffect(() => {
    if (loading) {
      setLoader(true);
      return;
    }
    if (user) {
      setLoader(false);
      //   navigate(-1);
      console.log(user);
    }
  }, [user, loading]);

  return (
    <div className="relative">
      <div className="w-fit my-20 flex gap-8 mx-auto items-center relative">
        {/* {loader ? <div>Loading</div> : <></>} */}

        <div className="flex flex-col gap-8 w-[30rem]">
          <div className="flex flex-col gap-4">
            <h1 className="text-3xl font-bold font-bodyFont tracking-wider">
              Create Account
            </h1>
            <div className="flex gap-4 items-center">
              <div className="flex gap-4">
                <div
                  onClick={signInWithGoogle}
                  className=" relative group rounded-full flex items-center justify-center bg-gray-100 p-3 w-full hover:bg-gray-200 duration-200 cursor-pointer"
                >
                  <img src={google} className="w-6" alt="" />
                  <div
                    className="scale-0 opacity-0 group-hover:opacity-100 before:content-[''] 
                before:w-2 before:aspect-square before:bg-gray-200 before:rotate-45 before:-top-1 -before:translate-x-1/2 
                before:right-[21px] before:absolute  group-hover:scale-100 flex duration-200 bg-gray-200 text-gray-500 rounded absolute text-[10px] -bottom-6 px-2   py-[1px]"
                  >
                    <span>Google</span>
                  </div>
                </div>
                <div className="group relative rounded-full bg-gray-100 flex items-center justify-center p-3 w-full hover:bg-gray-200 duration-200 cursor-pointer">
                  <img src={facebook} className="w-5" alt="" />
                  <div
                    className="scale-0 opacity-0 group-hover:opacity-100 before:content-[''] 
                before:w-2 before:aspect-square before:bg-gray-200 before:rotate-45 before:-top-1 -before:translate-x-1/2 
                before:right-[28px] before:absolute  group-hover:scale-100 flex duration-200 bg-gray-200 text-gray-500 rounded absolute text-[10px] -bottom-6 px-2   py-[1px]"
                  >
                    <span>Facebook</span>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div className="flex flex-col gap-6">
            <span className="font-light text-sm text-gray-500">
              or use your email for registration
            </span>
            <input
              type="text"
              placeholder="Email"
              className="border border-gray-400 px-4 py-2 w-full focus-visible:outline-green-600"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
            <input
              type="password"
              placeholder="Password"
              className="border border-gray-400 px-4 py-2 w-full focus-visible:outline-green-600"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
          <div className="flex gap-10 items-center justify-between">
            <button
              onClick={() => loginWithEmail(email, password)}
              className="w-48 text-base uppercase text-white tracking-wider font-titleFont font-medium py-3 bg-green-500 hover:bg-green-600 duration-200 rounded-full"
            >
              Login
            </button>
            {/* <Link to="/reset"> */}
            <span className="uppercase relative font-titleFont tracking-wider text-xs font-medium text-gray-500 hover:text-black after:content-[''] after:h-px after:w-full after:scale-x-0 hover:after:scale-x-100 after:duration-300 duration-300 after:bg-black cursor-pointer after:absolute after:bottom-0 after:left-0">
              forgot password?
            </span>
            {/* </Link> */}
          </div>

          <div onClick={logout}>SIGNOUT</div>
        </div>
        <div className="absolute right-0 top-10 flex gap-2 font-titleFont">
          <span>New User?</span>
          <span className="text-green-600 font-semibold hover:text-green-700 after:content-[''] scale-x after:h-px after:w-full after:scale-x-0 hover:after:scale-x-100 after:duration-300 after:bg-green-700 after:absolute after:bottom-0 after:left-0 cursor-pointer duration-200 relative">
            Sign Up
          </span>
        </div>
        <div>
          <img src={signup} alt="" className="w-[30rem]" />
        </div>
      </div>
    </div>
  );
};
